import { useEffect, useState } from "react";
import "./App.css";

function Users() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8081/users")
      .then((res) => res.json())
      .then((json) => {
        setUser(json);
      });
  }, []);
  return (
    <div className="Users">
      {user.map((item, i) => {
        return (
          <div>
            {item.username} - {item.email}
          </div>
        );
      })}
      <div></div>
    </div>
  );
}

export default Users;
